import React, { Component } from 'react';
import Aux from '../../hoc/Aux/Aux';
import classes from './Summary.module.css';


class Summary extends Component{

    render(){
        let fullSequence = '';
        for(let character in this.props.seq){
            //console.log(this.props.seq[character].fontcolor('red'));
            switch(this.props.seq[character]){
                case('A'):
                    this.props.seq[character].fontcolor('red');
                case('G'):
                    this.props.seq[character].fontcolor('green');
                case('T'):
                    this.props.seq[character].fontcolor('blue');
                case('C'):
                    this.props.seq[character].fontcolor('indigo');
                default:
                    this.props.seq[character].fontcolor('black');

            }
            console.log(this.props.seq[character]);
            fullSequence += this.props.seq[character];

        }
        console.log(fullSequence);
        return(
            <Aux>

                <p>{fullSequence}</p>

            </Aux>
        );
    }



};

export default Summary;
